import React from 'react';
import './Category.css';

function Category() {
  return (
    <div className="category">
      <h1>Fitness Plans</h1>
      <ul>
        <li>30-day Plan</li>
        <li>45-day Plan</li>
        <li>60-day Plan</li>
        <li>Quarterly Plan</li>
        <li>Half-Yearly Plan</li>
        <li>Yearly Plan</li>
      </ul>
    </div>
  );
}

export default Category;
